(66, 4, '2012-01-20 19:15:35', 'Magento''s Imagine eCommerce Conference 2012 – Registration Now Open!', 'Registration for the 2012 Imagine eCommerce Conference is officially OPEN! With an expected attendance of over 1000 Magento enthusiasts, this yearâ€™s exclusive event is taking place in Las Vegas, April 23rd – 25th at the luxurious M Resort. Join us for an unforgettable experience!', 'http://www.magentocommerce.com/blog/comments/registration-for-imagine-ecommerce-2012-is-live/', 0, 0),
