INSERT INTO `catalog_product_entity_text` (`value_id`, `entity_type_id`, `attribute_id`, `store_id`, `entity_id`, `value`) VALUES
(5, 4, 66, 0, 2, 'Foloseste extensiile de tip keratina pentru un plus de volum si lungime\r\n<span style="white-space: pre;"> </span>-  par natural 100% remy\r\n<span style="white-space: pre;"> </span>-  tip microring (fixarea suvitelor cu inele)\r\n<span style="white-space: pre;"> </span>-  gramaj: 1,25 grame/suvita -  provenit de la donatori\r\n<span style="white-space: pre;"> </span>-  se pot vopsi, decolora, intinde cu placa, coafa</p>\r\n<span style="white-space: pre;"> </span>-  un set contine 50 de suvite   Recomandam minim 100 - 150 de suvite\r\nAvantajele folosirii extensiilor tip keratina sunt:\r\n<span style="white-space: pre;"> </span>-          Un plus de volum\r\n<span style="white-space: pre;"> </span>-          Nu deterioreaza parul\r\n<span style="white-space: pre;"> </span>-          Costuri reduse pentru intretinere\r\n<span style="white-space: pre;"> </span>-          Rezistenta la spalare'),
