(62, 4, 66, 0, 8, '<p>Foloseste extensiile de tip keratina pentru un plus de volum si lungime<br/>-  par natural 100% remy<br/> -  tip microring (fixarea suvitelor cu inele)<br/> -  gramaj: 1,25 grame/suvita<br/> -  provenit de la donatori<br/> -  se pot vopsi, decolora, intinde cu placa, coafa<br/> -  un set contine 50 de suvite   Recomandam minim 100<br/> - 150 de suvite<br/>   Avantajele folosirii extensiilor tip keratina sunt: <br/>-          Un plus de volum <br/>-          Nu deterioreaza parul<br/> -          Costuri reduse pentru intretinere <br/>-          Rezistenta la spalare</p>'),
